create database zufang;
use zufang;
create table data1(
	id int(4) not null AUTO_INCREMENT,
    title varchar(100),
    name varchar(50),
    `楼层`	varchar(20),
    `户型`	varchar(20),
	area	varchar(20),
	`朝向`	varchar(20),
    `其他`	varchar(100),
    money	varchar(20),
    primary key(id)
)ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

